import React from 'react';

const ImageList = () => {
  const images=props.images.map((image)=>{
    return (
      <a href={image.pageURL} 
      key={image.id} 
      target='_blank' 
      rel='noopener noreferrer'
      className='ui medium image'
      >
        <img src={image.webformatURL} alt={image.tags} />
      </a>
    )
  })
  return (
    <div>
      <dib>{images}</dib>
    </div>
  );
};

export default ImageList;
